class Submission:
    def __init__(self, user_id, status, submission_date):
        self.user_id = user_id
        self.status = status
        self.submission_date = submission_date
        self.errors = []

    def update_status(self, new_status):
        self.status = new_status

    def add_error(self, error_message):
        self.errors.append(error_message)


class SubmissionManager:
    def __init__(self):
        self.submissions = {}
        self.logs = []

    def create_submission(self, user_id, status, submission_date):
        submission_id = len(self.submissions) + 1
        submission = Submission(user_id, status, submission_date)
        self.submissions[submission_id] = submission
        self.log(f"Submission created: {submission_id}")
        return submission_id

    def update_submission_status(self, submission_id, new_status):
        if submission_id in self.submissions:
            self.submissions[submission_id].update_status(new_status)
            self.log(f"Submission {submission_id} status updated to: {new_status}")
        else:
            self.log(f"Attempted to update non-existent submission: {submission_id}")

    def add_error_to_submission(self, submission_id, error_message):
        if submission_id in self.submissions:
            self.submissions[submission_id].add_error(error_message)
            self.log(f"Error added to submission {submission_id}: {error_message}")
        else:
            self.log(f"Attempted to add error to non-existent submission: {submission_id}")

    def log(self, message):
        self.logs.append(message)


